- input: "TEXT\x1CC00166710\x1CTEXT-00001\x1C\x1CF3XN\x1CPlease note that the employees
    that were disclosed on Schedule H4 supporting Line 21(a) as payroll spent less
    than 25% of their time during the period working on Federal Election Activity
    or activities in connection with a Federal Election therefore salary payments
    were allocable.  This also includes fringe benefits for those specific employees.
    \ -    -  Determination of usual and normal charges for Enhanced Online Voter
    File Access for payments received on Schedule A, Line 17 of the Committees report
    was calculated by the total cost of developing and hosting our online voter file
    and dividing it by the number of records within the file as well as the presumed
    number of overall users.  The cost to the organization is then determined by the
    number of records requested and the length of time access will be granted.  i.e.
    Statewide or congressional charges are based on the number of records in the district
    or entire state as requested.  -    -   Memo Schedule A's that itemize the committees
    share of the gross contributions received through the joint fundraising activities
    from the ASDC Partnership Program (Association of State Democratic Chairs), and
    the Democratic National Committee Victory Fund are provided on a quarterly basis.
    \   The transfer of the joint fundraising proceeds received during this reporting
    period from the  ASDC Partnership program and the Democratic National Committee
    Victory Fund represents the committee's share of proceeds for contributions received
    during this or prior reporting periods. The memo entries for these contributions
    are included in this or a prior report of the Committee."
  record: fec.version.v6_2.TEXT
  result:
  - name: REC TYPE
    number: '1'
    value: TEXT
  - name: FILER COMMITTEE ID NUMBER
    number: '2'
    value: C00166710
  - name: TRANSACTION ID NUMBER
    number: '3'
    value: TEXT-00001
  - name: BACK REFERENCE TRAN ID NUMBER
    number: '4'
    value: ''
  - name: BACK REFERENCE SCHED / FORM NAME
    number: '5'
    value: F3XN
  - name: TEXT4000
    number: '6'
    value: Please note that the employees that were disclosed on Schedule H4 supporting
      Line 21(a) as payroll spent less than 25% of their time during the period working
      on Federal Election Activity or activities in connection with a Federal Election
      therefore salary payments were allocable.  This also includes fringe benefits
      for those specific employees.  -    -  Determination of usual and normal charges
      for Enhanced Online Voter File Access for payments received on Schedule A, Line
      17 of the Committees report was calculated by the total cost of developing and
      hosting our online voter file and dividing it by the number of records within
      the file as well as the presumed number of overall users.  The cost to the organization
      is then determined by the number of records requested and the length of time
      access will be granted.  i.e. Statewide or congressional charges are based on
      the number of records in the district or entire state as requested.  -    -   Memo
      Schedule A's that itemize the committees share of the gross contributions received
      through the joint fundraising activities from the ASDC Partnership Program (Association
      of State Democratic Chairs), and the Democratic National Committee Victory Fund
      are provided on a quarterly basis.    The transfer of the joint fundraising
      proceeds received during this reporting period from the  ASDC Partnership program
      and the Democratic National Committee Victory Fund represents the committee's
      share of proceeds for contributions received during this or prior reporting
      periods. The memo entries for these contributions are included in this or a
      prior report of the Committee.
- input: "TEXT\x1CC00166710\x1CTEXT-00002\x1C\x1CF3XA\x1CThe Committee is in receipt
    of the Commission's Request for Additional Information dated 8/20/2008 regarding
    the July Monthly Report.  Please note that the Ironworkers Political Action League
    Multicandidate contribution reported on 6/16/2008 is registered with the FEC under
    C00027359; although the name on the check had the C00027359 printed on it, further
    research has found that their registered name is INT'L. ASSOCIATION OF BRIDGE,
    STRUCTURAL, ORNAMENTAL & REINFORCING IRON WORKERS (IPAL).  In addition, the committee
    previously reported the contribution on 11(a)(i) vs. 11C.  This amendment corrects
    that discrepancy as well.  -  In addition to the previous discepancy on the Detailed
    Summary Page the committee found duplicates in the database that when combined
    the aggregate contributions for the individual met the threshold for itemized
    contributions.  This in turn changed the totals on the detailed summary page for
    lines 11(a)(i) and 11(a)(ii) - The overall total for 11(a)(iii) remain the same.
    \ Previous reports and subsequent reports have been amended to correct the totals."
  record: fec.version.v6_2.TEXT
  result:
  - name: REC TYPE
    number: '1'
    value: TEXT
  - name: FILER COMMITTEE ID NUMBER
    number: '2'
