  - name: BACK REFERENCE TRAN ID NUMBER
    number: '4'
    value: ''
  - name: BACK REFERENCE SCHED / FORM NAME
    number: '5'
    value: F3XA
  - name: TEXT4000
    number: '6'
    value: The Committee is in receipt of the Commission's Request for Additional
      Information dated 8/20/2008 regarding the July Monthly Report.  Please note
      that the Ironworkers Political Action League Multicandidate contribution reported
      on 6/16/2008 is registered with the FEC under C00027359; although the name on
      the check had the C00027359 printed on it, further research has found that their
      registered name is INT'L. ASSOCIATION OF BRIDGE, STRUCTURAL, ORNAMENTAL & REINFORCING
      IRON WORKERS (IPAL).  In addition, the committee previously reported the contribution
      on 11(a)(i) vs. 11C.  This amendment corrects that discrepancy as well.  -  In
      addition to the previous discepancy on the Detailed Summary Page the committee
